import React, { Component } from "react";
import * as actions from "../../store/actions/index";
import { connect } from "react-redux";
import WorkComponent from "../../components/Works/WorkComponent/WorkComponent";
import classes from "./Works.module.css";
class MyWorks extends Component {
  componentDidMount() {
    this.props.onUploadWorks
  }
  render() {
    return (
      <React.Fragment>
        <ul className={classes.WorkList}>
          <WorkComponent />
          <WorkComponent />
          <WorkComponent />
          <WorkComponent />
        </ul>
      </React.Fragment>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    token: state.token,
    userId: state.userId,
    error: state.error,
    redirect: state.redirect,
    loading: state.loading,
  };
};
const mapDispatchToProps = (dispatch) => {
  return {
    onUploadWorks: (userId) => dispatch(actions.uploadWorks(userId)),
    setRedirectPath: (path) => dispatch(actions.setRedirectPath(path)),
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(MyWorks);
